import React from 'react';
import { useSelector } from 'react-redux';
import AppLayout from '../components/layout/AppLayout';
import styled from 'styled-components';

const UserInfoWrap = styled.div`
    width: 100%;
    position: absolute;
    top: 275px;
    left: 100px;
`

const UserImage = styled.div`
    width: 150px;
    height: 150px;
    border-radius: 50%;
    background: red;
`

const UserInfo = styled.div`
    position: absolute;
    top: 30px;
    left: 200px
`

const NickName = styled.div`
    font-size: 2rem;
`

function myPage() {
    const { me } = useSelector((state) => state.user);


    return (
        <AppLayout>
            <div style={{ position: 'relative', marginLeft: '200px' }}>
                <div style={{ height: '350px', background: 'gray', opacity: '.2' }}></div>
                <UserInfoWrap>
                    <UserImage></UserImage>
                    <UserInfo>
                        <h3>닉네임</h3>
                        <div>
                            <div>follw 수</div>
                            <div>리뷰 수</div>
                            <div>follow 버튼</div>
                        </div>
                    </UserInfo>
                </UserInfoWrap>
            </div>
        </AppLayout>
    )
}

export default myPage
